import React from 'react';



function Calculate(props){

      const totalTime = props?.time1 + props?.time2 + props?.time3

    return (



        <div>

    <h1>Total Time </h1>

        <span>{props.time1}</span>&nbsp;&nbsp;
        <span>{props.time2}</span>&nbsp;&nbsp;
        <span>{props.time3}</span>&nbsp;&nbsp;
        </div>


      );

};

export default Calculate;
